import React from 'react';
import { useState } from "react";
import Sidebar from './Sidebar';
import {Link} from 'react-router-dom';
function Payment(){
    const [firstname, setFirstName] = useState("");
    const [lastname, setLastName] = useState("");
    const [email, setEmail] = useState("");
    function handleFormSubmit(e) {
        e.preventDefault();}
return( <>
 <Sidebar>
    <div className="search-main">
      <div className="search-heading">Payment</div> 
      <div><h2 style={{color:'#35414F', marginLeft:450, marginTop:60, position:'absolute'}}>Patient's Information</h2></div>
    <div className='form-main'>
      <form onSubmit={handleFormSubmit}>

              <div className="payment-group">
                <label className='payment-label'>First name</label>
                <input
                  type="text"
                  className="payment-control"
                  placeholder="Enter your first name"
                  value={firstname}
                  onChange={(event) => setFirstName(event.target.value)}
                />
              </div>
              <div className="payment-group">
                <label className='payment-label'>Last name</label>
                <input
                  type="text"
                  className="payment-control"
                  placeholder="Enter your last name"
                  value={lastname}
                  onChange={(event) => setLastName(event.target.value)}
                />
              </div>

              <div className="payment-group">
                <label className='payment-label'>Email</label>
                <input
                  type="email"
                  className="payment-control"
                  placeholder="Enter email"
                  value={email}
                  onChange={(event) => setEmail(event.target.value)}
                />
              </div>

            <Link to="/payment-info">
            <div>
              <button type="submit" className="payment-button">
                Proceed
              </button></div></Link>  
           
            </form>
            </div>
             </div></Sidebar>
    </>
)

}
export default Payment;
